  ["what"] = "<html><body><h1>what</h1><p>pron., a., & adv. As an interrogative pronoun, used in asking<p></p>   questions regarding either persons or things; as, what is this? what<p></p>   did you say? what poem is this? what child is lost?<p></p>pron., a., & adv. As an exclamatory word: -- (a) Used absolutely<p></p>   or independently; -- often with a question following.<p></p>pron., a., & adv. Used adjectively, meaning how remarkable, or<p></p>   how great; as, what folly! what eloquence! what courage!<p></p>pron., a., & adv. Sometimes prefixed to adjectives in an<p></p>   adverbial sense, as nearly equivalent to how; as, what happy boys!<p></p>pron., a., & adv. As a relative pronoun<p></p>pron., a., & adv. Used substantively with the antecedent<p></p>   suppressed, equivalent to that which, or those [persons] who, or those<p></p>   [things] which; -- called a compound relative.<p></p>pron., a., & adv. Used adjectively, equivalent to the . . .<p></p>   which; the sort or kind of . . . which; rarely, the . . . on, or at,<p></p>   which.<p></p>pron., a., & adv. Used adverbially in a sense corresponding to<p></p>   the adjectival use; as, he picked what good fruit he saw.<p></p>pron., a., & adv. Whatever; whatsoever; what thing soever; --<p></p>   used indefinitely.<p></p>pron., a., & adv. Used adverbially, in part; partly; somewhat;<p></p>   -- with a following preposition, especially, with, and commonly with<p></p>   repetition.<p></p>n. Something; thing; stuff.<p></p>interrog. adv. Why? For what purpose? On what account?</p><p>pron. 什么<p></p>interj. 怎么, 多么<p></p>a. 什么的<p></p>adv. 到什么程度</p></body></html>",
